import React from 'react';

function Header({titulo}) {
    return(
        <nav>
            <div className="nav-wrapper ligt-blue darken-2">
                <a href="#!" className="brand-logo">{titulo}</a>
            </div>
        </nav>
    )
}

export default Header;
